    false,nt"url": null,nt"notes": "The ECOFOC_GEO10 layer represents Terrestrial
    Conservatioin Focus Areas that are greater than or equal to 10 hectares in size.
    Conservation Focus Areas are threatened areas of ecological importance. They range
    from 0 (no risk, no importance) to 3 (high risk, high importance). They were derived
    from a series of data sets, including agriculture, development and toxic threats,
    a measure of ecological significance and an analysis of irreplaceability for a set
    of conservation targets. Full details of the procedure can be found in Diamond,
    Sowa and Foster, 2005, "Development of Conservation Focus Area Models for EPA Region
